column13:
The invention relates to a lateral power semiconductor device, comprising: 
- a source pad area formed in a metal layer of the device; 
- a drain pad area, spaced apart from said source pad and formed in said metal layer of the device; 
- a plurality conductive fingers formed in a further metal layer of the device, and comprising: 
- a plurality of parallel source fingers coupled to and extending from said source pad area towards and underneath said drain pad area, and 
- a plurality of parallel drain fingers isolated from said plurality of source fingers, and coupled to and extending from said drain pad area towards and underneath said source pad area, wherein said drain fingers are interdigitated between said source fingers; and wherein said drain pad area comprises a plurality of drain pads, one for each of said plurality of drain fingers, wherein said plurality of drain pads are isolated from each other by a spacing corresponding to the position of said source fingers extending underneath said drain pad area.
